import './App.css';
import HelloWord from './components/HelloWord'
import Frase from './components/Frase'

function App() {

    const name = "Tiago";

    const newName = name.toUpperCase()

    function sum(a, b) {
        return a + b
    }

    // Alteração de atributos
    const url = "https://via.placeholder.com/150"

    return ( <
        div className = "App" >



        <
        h2 > Alterando O JSX < /h2>      <
        p > Olá, { newName } < /p>     <
        p > Soma: { sum(5, 9) } < /p>     <
        img src = { url }
        alt = "Minha Imagem" / >

        <
        Frase / >

        <
        HelloWord / >

        <
        Frase / >
        <
        /div>
    );
}

export default App;
